import React from 'react';
import { Link } from 'react-router-dom';
import './NavBar.css'


export default function NavBar() {

  return (
    <div id='navbar'>
      <Link to='/'>
        <button>
          Sorting
        </button>
      </Link>
      <Link to='/pathfinding'>
        <button>
          Pathfinding
        </button>
      </Link>

    </div>
  )
}
